import React from 'react';

/*
    Legg til onClick p친 pil tilbake for 친 g친 til forrige side
    Legg til onClick p친 칮l for 친 komme til hjemsiden
    Legg til onHove
*/

export class Header extends React.Component {


    render() {
        return(
            <div className='fixed top-0 bg-violet-600 w-screen h-20 flex items-center justify-center shadow-2xl'>
                <div className='inline-flex pb-4 content-center'>

                    <div className='pt-5 pr-28'>
                        <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="white" className="w-6 h-6">
                            <path strokeLinecap="round" strokeLinejoin="round" d="M11.25 9l-3 3m0 0l3 3m-3-3h7.5M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
                        </svg>
                    </div>

                    <p className='font-thin text-bold text-base content-center pt-5  text-white'>Dashboard</p>
                    <p className='pt-3 pl-28 text-3xl'>游꽅</p>
                </div>
            </div>
        );
    }
}
